          radioButtonStandfunktionen->Enabled = true;
          radioButtonPAD->Enabled = true;
          radioButtonFBHerstellen->Enabled = true;
          radioButtonFahren->Enabled = false;

          radioUnitkmh->Enabled = true;
          radioUnitMile->Enabled = true;
          radioUnitCelsius->Enabled = true;
          radioUnitFahrenheit->Enabled = true;
          radioUnitBar->Enabled = true;
          radioUnitPsi->Enabled = true;
          radioUnitKpa->Enabled = true;

          checkBoxSelTempExSource->Checked = false;
          checkBoxSelPressExSource->Checked = false;
          checkBoxSelNMEARawData2Source->Checked = false;
          checkBoxSelSpeedSource->Checked = false;
          checkBoxSelGearSource->Checked = false;
          checkBoxBedienungFahrwerkSource->Checked = false;
          checkBoxSetPWFSource->Checked = false;
